function PortFolio(props) {
  const downloadURI = (uri, name) =>
{
    var link = document.createElement("a");
    link.download = name;
    link.href = uri;
    link.click();
}

  return (
    <Body>
      <MainDiv>
        <MainCard >
          <CardContentDiv>
            <ContentDiv> </ContentDiv>
            <center>
              <TextDiv>
                Hi I'm Sethu Kumar
                 </TextDiv>
              <TextDiv1>
                React Developer(React,Redux,Mobx,Html,Css,Javascript)
                 </TextDiv1>
            </center>
          </CardContentDiv>
        </MainCard>

        {/* Work Experience */}

        <WorkExperienceMainDiv>
          <TypographyDiv>
            <TextDiv3>
              Work Experience
          </TextDiv3>
          </TypographyDiv>

          <TitleDiv1>
            <Logo1 src={Bigapp} />
            {/* <YearTag>(2020 Feb - Now)</YearTag> */}
            <HeaderTag1>
              Project :
          </HeaderTag1>

            <BorderDiv>
              <TypographyDiv>
                <ThumbUpAltIconTag />
                <SideHeaderTage>
                  Curio Travel and Expense.
              </SideHeaderTage>
              </TypographyDiv>
            </BorderDiv>
            <Break />
          </TitleDiv1>

          <TitleDiv2>
            <Logo2 src={Novisync} />
            {/* <YearTag1>(2018 Nov - 2020 Jan)</YearTag1> */}
            <HeaderTag1>
              Projects :
          </HeaderTag1>

            <BorderDiv>
              <TypographyDiv>
                <ThumbUpAltIconTag />
                <SideHeaderTage>
                  NExam-Online Test Project.
              </SideHeaderTage>
              </TypographyDiv>
              <Break />

              <TypographyDiv>
                <ThumbUpAltIconTag />
                <SideHeaderTage>
                  Novisync & Cadrac Labs Websites.
             </SideHeaderTage>
              </TypographyDiv>
              <Break />

              <TypographyDiv>
                <ThumbUpAltIconTag />
                <SideHeaderTage>
                  Jobbuzz.
           </SideHeaderTage>
              </TypographyDiv>
            </BorderDiv>
          </TitleDiv2>
          <Break />
        </WorkExperienceMainDiv>

        {/* Tech Logo carousel */}

        <MainCarouselDiv>
          <TextDiv5>
            Technologies
          </TextDiv5>

          <TechLogos>
            <TechCarousel
              interval={2000}
              showIndicators={false}
              showStatus={false}
              showThumbs={false}
              showArrows={false}
              infiniteLoop
              autoPlay
            >
              <StyledCarouselEdu>
              <TechImagesReact src={ReactJs} />
              </StyledCarouselEdu>
              <StyledCarouselEdu>
              <TechImages src={Redux} />
              </StyledCarouselEdu>
              <StyledCarouselEdu>
              <TechImages src={Mobx} />
              </StyledCarouselEdu>
              <StyledCarouselEdu>
              <TechImages src={Html} />
              </StyledCarouselEdu>
            </TechCarousel>
          </TechLogos>
        </MainCarouselDiv>
        <Break />

